description:
116 min | Crime | 1 May 2015 (UK)

Two brothers; Graffiti-artist Dee confronts the establishment with spray-paint campaigns across London. Armed-robber Marcus leads motorbike-gang jewellery-store raids across the city. For both Dee and Marcus, being Anti-Social is a way of life! Challenging the system, Dee's graffiti unintentionally enchants the art-elite and he enters the gallery world, embracing the lifestyle with fashion-model girlfriend Kirsten. Meanwhile, Marcus' daredevil heists gain him credibility with an organised-crime syndicate and his aspirations drastically escalate. After an acclaimed exhibition, Dee uproots to Berlin - Europe's graffiti capital - but as he does, Marcus' world erupts in a savage gangland-war. With the law and the lawless weighing-down, Dee is forced to step into a criminal conspiracy to aid his brother and risk everything he has now become!

Director: Reg Traviss

Stars: Gregg Sulkin, Meghan Markle, Josh Myers


